import axios from "axios";

// eslint-disable-next-line
const postSignup = async (body) => {

    axios({
        method: 'post',
        url: 'http://food-power.glitch.me/sign-up',
        headers: {},
        data: body
    })
        .then(function (response) {
            return response.data;
        });
};

// const postSignup = async (body) => {
